import React, { useState, useEffect } from "react";
import axios from "axios";
import './artist.css'
import CircularProgressWithLabel from '@mui/material/CircularProgress';
import Box from '@mui/material/Box';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSpotify } from "@fortawesome/free-brands-svg-icons";



export default function CardArtist(props) {
  const [artist, setArtist] = useState([]);

//   React.useEffect(() => {
//     axios
//       .get("/api/searchArtist?id=" + props.props.eventId)
//       .then((response) => {
//         console.log("API response:", response.data);
//         setArtist(response.data);
//       })
//       .catch((error) => {
//         console.error(error);
//       });
//   }, []);

  React.useEffect(() => {

    const getData = setTimeout(async () => {
        const response = await fetch(`/api/searchArtist?id=${props.props.eventId}`);
        const apiResponse = await response.json();

        setArtist(apiResponse)

    }, 10)

    return () => clearTimeout(getData)
    }, [])

  console.log("Artist data:", artist);

  return (
    <div>
      <div id="artist-carousel" className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-indicators">
          {artist.map((item, index) => (
            <button key={index} type="button" data-bs-target="#artist-carousel" data-bs-slide-to={index} className={index === 0 ? "active" : ""} aria-current={index === 0 ? "true" : "false"} aria-label={`Slide ${index + 1}`}></button>
          ))}
        </div>
        <div className="container-fluid">
        <div className="carousel-inner">
          {artist.map((item, index) => (
            <div key={index} className={`carousel-item ${index === 0 ? "active" : ""}`}>
              <div className="row">
              <div className="col-md-3 text-center"> 
              {/* <p>Name: {Object.keys(item)}</p> */}
              <div className="m-3"><img src={item[Object.keys(item)].artistImage} className="rounded-circle img-fluid"/>
              <p>{item[Object.keys(item)].name}</p>
              </div>
              </div>
              <div className="col-md-3 text-center" style={{verticalAlign:'centre'}}> <p>Follower Count: {item[Object.keys(item)].followerCount.toLocaleString()}</p></div>
              <div className="col-md-3 text-center"> <CircularProgressWithLabel variant="determinate" value={Math.min(Math.max(parseFloat(item[Object.keys(item)].popularity), 0), 100)} color='error'label={`${Math.round(Math.min(Math.max(parseFloat(item[Object.keys(item)].popularity), 0), 100))}%`} />
              <p>Popularity: {item[Object.keys(item)].popularity}</p></div>
              <div className="col-md-3 text-center"><FontAwesomeIcon icon={faSpotify} style={{ color: "#1db954", fontSize:'40px' }} /><br /><a href={item[Object.keys(item)].externalUrl}>Spotify Link</a></div>
            </div>
            </div>
          ))}
        </div>
        <button className="carousel-control-prev" type="button" data-bs-target="#artist-carousel" data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target="#artist-carousel" data-bs-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
        </button>
      </div>
    </div>
  </div>
        
  );
}
